import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Patients } from '../model/Patients';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ServicesService {

  baseUrl='http://localhost:8083';
  constructor(private http:HttpClient){}

  addPatients(Patient : Object) : Observable<any>{
    return this.http.get(`${this.baseUrl}/addpat` , Patient)
  }

  getAllPatients() {
     return this.http.get(`${this.baseUrl}/getallpatients`);
  }

  getOnePatient(patientsId: number) {
    throw new Error('Method not implemented.');
  }



  createPatient(patients: Object):Observable <Object>
  {
    console.log(patients);
    return this.http.post(`${this.baseUrl}/add`,patients);
  }

}
